import React from 'react'
import WinsByTimeGraph from './WinsByTimeGraph';
import './Graphs.css';
import WinsByColorGraph from './WinsByColorGraph';
import WinsByWhiteDonut from './WinsByWhiteDonut';

function Graphs({ chessgames, cumulativeData }) {
  return (
    <div className='container'>
        <div className='winsGraph'>
          <WinsByTimeGraph chessgames={chessgames} cumulativeData={cumulativeData}/>
        </div>
        <div>
          <WinsByColorGraph cumulativeData={cumulativeData}/>
        </div>
        <div>
          <WinsByWhiteDonut cumulativeData={cumulativeData} />
        </div>
        <div>
          <WinsByBlackeDonut cumulativeData={cumulativeData} />
        </div>
    </div>
  )
}

export default Graphs;
